import { Routes, Router, Route } from 'react-router-dom';
import './App.css';
import MainPage from './components/MainPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path='/' element={<Home />} exact/>
        <Route path='/signin' element={<SigninPage />} exact/>
      </Routes>
    </Router>
  );
}

export default App;
